window.bookSummaryJSON = "<p><b>The sequel to the</b> <b><i>New York Times</i></b> <b>best seller</b> <b><i>Skyward</i></b><b>! </b></p> <p><b>From the number-one</b> <b><i>New York Times</i></b> <b>best-selling author of the Reckoners series,</b> <b><i>Words of Radiance,</i></b> <b>the Mistborn trilogy, and the Stormlight Archive comes the second book in an epic series about a girl with a secret in a dangerous world at war for humanity's future. </b></p> <p>All her life, Spensa has dreamed of becoming a pilot. Of proving she's a hero like her father. She made it to the sky, but the truths she learned about her father were crushing. The rumors of his cowardice are true - he deserted his flight during battle against the Krell. Worse, though, he turned against his team and attacked them.&nbsp;</p> <p>Spensa is sure there's more to the story. And she's sure that whatever happened to her father in his starship could happen to her. When she made it outside the protective shell of her planet, she heard the stars - and it was terrifying. Everything Spensa has been taught about her world is a lie.&nbsp;</p> <p>But Spensa also discovered a few other things about herself - and she'll travel to the end of the galaxy to save humankind if she needs to.&nbsp;</p> <p>\"[A] nonstop, highflying opener.\" (<i>Kirkus Reviews,</i> starred review)&nbsp;</p> <p>\"With this action-packed trilogy opener, Sanderson offers up a resourceful, fearless heroine and a memorable cast.\" (<i>Publishers Weekly</i>)&nbsp;</p> <p>\"Sanderson delivers a cinematic adventure that explores the defining aspects of the individual versus the society.... Fans of Sanderson will not be disappointed.\" (<i>SLJ</i>)</p>"; 
